import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Home extends Component {
    saveCat = () => {
        fetch('/api/saveCat/Fauna/3/Sweet')
        .then(res => res.json());
    }
    render() {
        return (
            <div className="App">
                <h1>Project Home</h1>
                <Link to={'./list'}>
                    <button variant="raised">
                        My List
                    </button>
                </Link>
                <Link to={'./list'}>
                    <button onClick={this.saveCat} variant="raised">
                        saveCat
                    </button>
                </Link>
                <Link to={'./users'}>
                    <button variant="raised">
                        My User
                    </button>
                </Link>
                <Link to={'./Contact'}>
                    <button variant="raised">
                        Contact Me
                    </button>
                </Link>
            </div>
        )
    }
}

export default Home;
